import React from 'react';
import { SafeAreaView, Text } from 'react-native';
import { Ionicons } from '@expo/vector-icons';

export default function Home({ navigation }) {

  const renderHeader = () => {
    return(
      <View></View>
    )
  }

  return (
    <SafeAreaView>
        {renderHeader()}
    </SafeAreaView>
  );
}
